	n, m, s, d = list(map(int, input().split()))
	a = list(map(int, input().split()))

	p, s = set(), set(a)
	for i in range(n):
		if a[i] > m + s:
			p.add(i)

	jumps = sorted(((i - p[j], i) for i in p), reverse=True)
	cnt = 0
	for i, (j, k) in enumerate(jumps):
		d = s + k
		if j == n - i + 1 and d > m:
			print('IMPOSSIBLE')
			return
		if i not in p and j >= 0 and (d - k) <= s:
			print('RUN')
			return
		cnt += 1
	print('JUMP')

